import React from 'react'
import { Button } from 'semantic-ui-react'


export default class Welcome extends React.Component {

    render() {

        return (
            <Button.Group size='large'>
                <Button>Login</Button>
                <Button.Or />
                <Button>Three</Button>
            </Button.Group>

        )
    }

}
